describe('Protractor Demo App', function() {
  it('admin ', function() {
    browser.get('http://localhost:3000/admin.html');
    element(by.css('[data-ng-click="main.addNew()"]')).click();
    element(by.css('[data-ng-click="main.saveChanges()"]')).click();
  });
});
describe('Protractor Demo App', function() {
  it('new yes ', function() {
    browser.get('http://localhost:3000/');
    element(by.css('[data-ng-click="main.select(1)"]')).click();
    element(by.model('tech.problem')).sendKeys('this is the first keyword');
    element(by.css('[data-ng-show="tech.shouldShowSubmit()"]')).click();
    element(by.css('[data-ng-click="tech.foundSolution()"]')).click();
  });
});
describe('Protractor Demo App', function() {
  it('new no', function() {
    browser.get('http://localhost:3000');
    element(by.css('[data-ng-click="main.select(1)"]')).click();
    element(by.model('tech.problem')).sendKeys('check the first keyword');
    element(by.css('[data-ng-show="tech.shouldShowSubmit()"]')).click();
    element(by.css('[data-ng-click="tech.nextSuggestion()"]')).click();
  });
});